import React from 'react'
import './layout.css'

function layout() {
    return (
        <div class="menu"> 
        <a href="#home">HOME</a> 
        <a href="#news">NEWS</a> 
        <a href="#notification">NOTIFICATIONS</a> 
       
    </div> 
    )
}

export default layout
